import React, {Fragment} from "react";
import mealsImage from '../../assets/meals.jpg'

const Header = () =>{
    return(
        <Fragment>
            <header>
                <h1>ReactMeals</h1>
                <button>Cart</button>
            </header>
            <div>
                <img src="" alt="" />
            </div>
        </Fragment>
    )
}
export default Header;
